        instructions = TaskFamily.get_instructions(t)
        if 'object_description' in t:
            criteria = ["The description should include the shape, dimensions, material, and any additional features of the 3D object.", "The explanation should clearly describe any transformations the object has undergone."]
        elif 'creation_criteria' in t:
            criteria = ["The new 3D object description should include all specified elements in a coherent and detailed manner.", "The explanation should clearly describe any transformations applied to the object."]
        return 1.0 if eval_with_llm_judge(instructions, submission, criteria) else 0.0
"
}
